function evaluateProperty({api, helpers}) {
  var arr = [];
  var init_month = api.data.tab1getmonth.output.result[0].scores[0].end_at;
  var sel_month = api.state.Month;
  arr.push(sel_month === ''? init_month : sel_month);
  return arr;
}
